    of Hurricane-Induced Coastal Erosion Hazards: Northeast Atlantic Coast",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-10T06:16:30.790138",nt"name": "national-assessment-of-hurricane-induced-coastal-erosion-hazards-northeast-atlantic-coast",nt"isopen":
    false,nt"url": null,nt"notes": "These data sets contain information on
    the probabilities of hurricane-induced erosion (collision, inundation and overwash)
    for each 1-km section of the Northeast Atlantic coast for category 1-4 hurricanes.
    The analysis is based on a storm-impact scaling model that uses observations of
    beach morphology combined with sophisticated hydrodynamic models to predict how
    the coast will respond to the direct landfall of category 1-4 hurricanes. Hurricane-induced
    water levels, due to both surge and waves, are compared to beach and dune elevations
    to determine the probabilities of three types of coastal change: collision (dune
    erosion), overwash, and inundation. Data on dune morphology (dune crest and toe
    elevation) and hydrodynamics (storm surge, wave setup and runup) are also included
    in this data set. As new beach morphology observations and storm predictions become
    available, this analysis will be updated to describe how coastal vulnerability to
    storms will vary in the future. The data presented here include the dune morphology
    observations, as derived from lidar surveys taken from May to July, 2010.",nt"license_title":
